UPPER_BOUND = 1000000

# ------------
# collatz_read
# ------------

def collatz_read(s):
  """
  read two ints
  s a string
  return a list of two ints, representing the beginning and end of a range, [i, j]
  """
  # pre-condition
  assert isinstance(s, str)
  
  s = s.strip()
  if s == '':
    raise ValueError
  s = s.split()

  # post-(split)-conditions
  assert len(s) == 2
  assert s[0].isdigit() and s[1].isdigit()

  i, j =([int(n) for n in s])
  
  #post-(cast)-conditions
  assert 0 < i and i < UPPER_BOUND
  assert 0 < j and j < UPPER_BOUND
  
  return [i, j]

# ------------
# cycle_length
# ------------

def cycle_length(n):
  """
  n an int
  return the collatz cycle length of n
  """
  # base case: if cached, return cached value
  # note: pre-load cache with at least {1:1}
  global cache
  if n in cache:
    return cache[n]

  # recursive case
  if n % 2 == 0:
    l = 1 + cycle_length(n // 2)
  else:
    l = 2 + cycle_length(n +(n >> 1) + 1)

  assert l > 0
  # cache and return cycle length
  cache[n] = l
  return l


# ------------
# collatz_eval
# ------------

def collatz_eval(i, j):
  """
  i the beginning of the range, inclusive
  j the end       of the range, inclusive
  return the max cycle length of the range [i, j]
  """
  # pre-conditions
  assert isinstance(i, int) and isinstance(j, int)
  assert 0 < i and i < UPPER_BOUND
  assert 0 < j and j < UPPER_BOUND
  if i > j:
    i, j = j, i
  max_len = 1


  tile_size = UPPER_BOUND // len(TILES)
  i_tile = i // tile_size
  j_tile = j // tile_size

  # find max in TILES completely included in range
  if j_tile - i_tile > 1:
    for t in range(i_tile + 1, j_tile):
      if TILES[t] > max_len:
        max_len = TILES[t]
  
  # check for higher max in incomplete tile containing i
  if TILES[i_tile] > max_len:
    i_tile_max = 1
    for n in range(i, min(j + 1, i +(tile_size - i % tile_size))):
      i_tile_max = max(i_tile_max, cycle_length(n))
    max_len = max(max_len, i_tile_max)
  
  # check for higher max in incomplete tile containing j
  if i_tile != j_tile and TILES[j_tile] > max_len:
    j_tile_max = 1
    for n in range(j -(j % tile_size), j + 1):
      j_tile_max = max(j_tile_max, cycle_length(n))
    max_len = max(max_len, j_tile_max)
  
  assert max_len > 0
  return max_len

# -------------
# collatz_print
# -------------

def collatz_print(w, i, j, v):
  """
  print three ints
  w a writer
  i the beginning of the range, inclusive
  j the end       of the range, inclusive
  v the max cycle length
  """
  
  # pre-conditions
  assert hasattr(w, 'write')
  assert isinstance(i, int) and isinstance(j, int) and isinstance(v, int)
  assert 0 < i and i < UPPER_BOUND
  assert 0 < j and j < UPPER_BOUND

  w.write(str(i) + " " + str(j) + " " + str(v) + "\n")

# -------------
# collatz_solve
# -------------

def collatz_solve(r, w):
  """
  r a reader
  w a writer
  """
  # start = clock()

  # pre-conditions
  assert hasattr(r, 'read')
  assert hasattr(w, 'write')

  for s in r:
    try:
      i, j = collatz_read(s)
      v  = collatz_eval(i, j)
      collatz_print(w, i, j, v)
    except ValueError:
      continue
  # stop = clock()
  # print(stop - start)

